/**
 * Decoration component types enumeration
 * Defines the available component types for decorations
 */
export enum DecorationComponentType {
  /** Edge decoration component */
  decorationEdge = "decorationEdge",
  /** Corner decoration component (note: typo in original 'dcorationCorner') */
  dcorationCorner = "dcorationCorner",
  /** Polygon decoration component */
  decorationPoly = "decorationPoly",
  /** Line decoration component */
  decorationLine = "decorationLine",
  /** Arbitrary line decoration component */
  decorationLineArbitrary = "decorationLineArbitrary"
}

/**
 * Decoration bar types enumeration
 * Defines various styles of decoration bars
 */
export enum DecorationBarType {
  /** Simple decoration bar style */
  decorationSimple = "decorationSimple",
  /** Chinese style decoration bar */
  decorationChinese = "decorationChinese",
  /** Chinese style decoration bar variant 2 */
  decorationChinese2 = "decorationChinese2",
  /** Chinese style decoration bar variant 3 */
  decorationChinese3 = "decorationChinese3",
  /** Chinese style decoration bar variant 4 */
  decorationChinese4 = "decorationChinese4",
  /** Semi-arc decoration bar style */
  decorationSemiArc = "decorationSemiArc",
  /** Prairie style decoration bar */
  decorationPrairie = "decorationPrairie",
  /** Colonial style decoration bar */
  decorationColonial = "decorationColonial",
  /** Diamond style decoration bar */
  decorationDiamond = "decorationDiamond"
}

